<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Valentine's Proposal</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: pink;
            flex-direction: column;
            font-family: Arial, sans-serif;
            text-align: center;
            overflow: hidden;
            position: relative;
        }
        .buttons {
            margin-top: 20px;
            display: flex;
            gap: 50px;
            position: relative;
        }
        button {
            font-size: 20px;
            padding: 10px 20px;
            border: none;
            cursor: pointer;
            border-radius: 10px;
            position: relative;
        }
        #yes {
            background-color: red;
            color: white;
        }
        #no {
            background-color: gray;
            color: white;
            position: absolute;
        }
        .hidden {
            display: none;
        }
        .celebrate {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background: pink;
            font-size: 40px;
            color: white;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
            font-weight: bold;
        }
    </style>
</head>

        function moveButton() {
            let noButton = document.getElementById("no");
            let currentLeft = noButton.offsetLeft;
            let currentTop = noButton.offsetTop;
            let deltaX = (Math.random() * 200) - 100;
            let deltaY = (Math.random() * 200) - 100;
            let newX = Math.min(window.innerWidth - 150, Math.max(0, currentLeft + deltaX));
            let newY = Math.min(window.innerHeight - 100, Math.max(0, currentTop + deltaY));
            noButton.style.position = "absolute";
            noButton.style.left = `${newX}px`;
            noButton.style.top = `${newY}px`;
        }
